description:
Valhalla Rising (2009)  

Denemarken / Verenigd Koninkrijk
Actie / Avontuur
100 minuten

geregisseerd door Nicolas Winding Refn
met Mads Mikkelsen, Gary Lewis en Ewan Stewart

De slaaf One-Eye ontsnapt van zijn Schotse overheersers en vermoordt hen gruwelijk, voordat hij zich aansluit bij een groep Christenen die Jeruzalem willen heroveren. De reis gaat gepaard met aanvallen van onzichtbare strijders waarbij velen sterven.

Simply ReleaseS Toppers
